import React, { useState } from "react";
import { Link } from 'react-router-dom';
import "../css/navbar.css";
import Login from "./iniciar-sesion";

function Navbar() {

    const [loggedIn, setLoggedIn] = useState(false);
    const handleLogout = () => {
        // Aquí deberías agregar la lógica para cerrar sesión, como eliminar el token de sesión, etc.
        // Por ahora, simplemente simularemos cerrar sesión cambiando el estado loggedIn a false
        setLoggedIn(false);
    };
    useEffect(() => {
        // Verificar si el usuario ha iniciado sesión
        const isLoggedIn = localStorage.getItem('isLoggedIn');
        if (isLoggedIn) {
          setLoggedIn(true);
        }
      }, []);
      
    const handleLogin = () => {
        setLoggedIn(true);
      };
return (
<div className="contenedor-navbar">
    <nav className="navbar navbar-expand-lg bg-body-tertiary">
        <div className="container">
            <h1 className="navbar-brand text-center d-lg-none" >Oddballs</h1>
            <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                <span className="navbar-toggler-icon"></span>
            </button>
            <div className="collapse navbar-collapse" id="navbarNav">
                <ul className="navbar-nav">
                    <li className="nav-item">
                        <a href="/" className="nav-link active" >
                            <img src="../imagenes/imglogo.png"  
                                alt="Inicio"
                                style={{ width: '100px', height: '100px', marginLeft: '-50px' }}  
                            />
                        </a>
                    </li>
                    <li className="nav-item">
                        <Link to="/" className="nav-link dropdown" href="/videoteca">Tiendas</Link>
                    </li>
                    {!loggedIn && (
                        <>
                        <li className="nav-item dropdown">
                            <Link to="/iniciar-sesion" className="nav-link dropdown" href="/login">Iniciar sesión</Link>
                        </li>
                        <li className="nav-item dropdown">
                            <Link to="/formulario-cuenta" className="nav-link dropdown" href="/suscribete">Suscríbete</Link>
                        </li>
                        </>
                    )}
                    {loggedIn && (
                        <li className="nav-item">
                            <Link className="nav-link" onClick={handleLogout}>Cerrar sesión</Link>
                        </li>
                    )}
                   <li className="nav-item d-lg-none">
                        <button href="#" className="nav-link" id="closeMenu">
                            <i className="fas fa-times"></i>
                        </button>
                    </li>
                    <div className="input-group flex-nowrap">
                        <span className="input-group-text" id="addon-wrapping">Buscar</span>
                        <input type="text" className="form-control" aria-label="Buscar" aria-describedby="addon-wrapping" />
                    </div>
                </ul>
            </div>
            {loggedIn && (
                <div className="d-flex align-items-center">
                    <a to="/perfil" className="nav-link" href="/perfil">
                        <i class="bi bi-person-lines-fill" style={{fontSize:'3rem', marginRight: '50px', top:'-30px'}}></i>
                    </a>
                    <a className="nav-link active" aria-current="page" href="/" data-bs-toggle="modal" data-bs-target="#exampleModal">
                        <i class="bi bi-handbag" style={{fontSize:'3rem'}}></i>
                    </a>
                </div>
            )}
        </div>
    </nav>
    <Login onLogin={handleLogin} /> 
</div>

    );
}

export default Navbar;
